          sortable: true,
     },
     {
          name: 'Inventory',
          selector: row => row.inventory,
          sortable: true,
     },
     {
          name: 'Retail Price',
          selector: row => row.retailPrice,
          sortable: true,
     },
     {
          name: 'Channels',
          selector: row => row.channels,
          sortable: true,
     },
     {
          name: 'Created',
          selector: row => row.created,
          sortable: true,
     },
     {
          name:"Action",
        cell: () => {
             return (
                  <>
                       <span onClick={() => handleButtonClick(row._id)} className='btn btn-primary'><Pencil /></span>{'     '}
                       <span onClick={() => handleButtonClick(row._id)} className='btn btn-danger'><Trash /></span>
                  </>
             );
        },
        
        ignoreRowClick: true,
        allowOverflow: true,
        button: true,
     }
];
   
